;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;2d49e300-4f3b-4809-a321-b3e518032b00&quot;</span>","value":"\"2d49e300-4f3b-4809-a321-b3e518032b00\""}],"value":"(\"2d49e300-4f3b-4809-a321-b3e518032b00\")"}
