;; **
;;; ## 4.1 Matching semantics
;;; 
;;; Rules may be defined to use **_homomorphic_** or **_isomorphic_ matching** semantics. Homomorphic semantics is the default, and allows different graph elements in the rule to match the same graph elements in the graph that the rule is applied to. To understand this better, consider a graph (`g1`) with one `Hello` node:
;; **

;; @@
(def g1 (-> (newgrape) hello))
(view g1)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"425\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6549cf62 \"BufferedImage@6549cf62: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 425 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6549cf62 \"BufferedImage@6549cf62: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 425 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 425, :height 133})"}
;; <=

;; **
;;; Now consider the following rule. It matches "two" `Hello` nodes with a new relationship `rel`. 
;; **

;; @@
(rule 'rel 
   :read 	(pattern 
             (node 'h :label "Hello")
             (node 'h2 :label "Hello"))
   :create	(pattern 
             (edge :src 'h :tar 'h2 :label "rel")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"139\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xa1a5ad \"BufferedImage@a1a5ad: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 139 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Is this rule applicable to graph `g1`? The answer to this question depends on the matching semantics. If **_homomorphic_** matches are allowed, the two `Hello` nodes in rule `rel` may in fact be matched to the _same_ node in the graph the rule is applied to. This would result in a rule with a `rel` edge to itself:
;; **

;; @@
(view (rel g1))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6fd134f6 \"BufferedImage@6fd134f6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6fd134f6 \"BufferedImage@6fd134f6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 424, :height 133})"}
;; <=

;; **
;;; The above (homomorphic) matching semantics is the default. However, matching multiple nodes in a rule to a single node in the graph may not be desirable in some appliations. In this case, the rule designer can specify the rule to enforce **_isomorphic_** matching. The following rule is `rel2` identical to the above rule `rel`, except that it requires _isomorphic_ matches.
;; **

;; @@
(rule 'rel2 
   :read 	(pattern :iso
             (node 'h :label "Hello")
             (node 'h2 :label "Hello"))
   :create	(pattern 
             (edge :src 'h :tar 'h2 :label "rel")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"227\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6e805a1c \"BufferedImage@6e805a1c: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 227 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Applying that rule to our graph with a single `Hello` node should fail:
;; **

;; @@
(rel2 g1)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let's add another `Hello` node:
;; **

;; @@
(def g2 (hello g1))
(view g2)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"431\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7dce2be9 \"BufferedImage@7dce2be9: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x7dce2be9 \"BufferedImage@7dce2be9: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@426a2951 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 133 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 431, :height 133})"}
;; <=

;; **
