;; **
;;; ## 6.3 Atomic Constraints
;;; 
;;; As described above, atomic constraints have the general form **if @@X@@ then @@C@@**. (Remember that basic constraints are a special case, were the pattern @@X@@ is empty, intuitively: _if TRUE then @@X@@_)
;;; 
;;; Below is an example for an atomic constraint that is _not_ a basic constraint. A graph satisfies this constraint if (and only if) all `Hello` nodes are connected to a `Grape` node by a `to` edge.
;;; 
;;; As we can see, the pattern that belongs to the "if" part is represented in black colour.
;;; 
;; **

;; @@
(constraint 'if-hello-then-to-grape!
       (pattern (node 'h :label "Hello"))
       (pattern
                (node 'p :label "Grape")
                (edge :src 'h :tar 'p :label "to")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"301\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1c27c1db \"BufferedImage@1c27c1db: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@3a5833c9 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 301 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; An empty graph satisfies this constraint:
;; **

;; @@
(-> (newgrape) if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;cfbe6501-9add-496a-b88d-3fa052a88a41&quot;</span>","value":"\"cfbe6501-9add-496a-b88d-3fa052a88a41\""}],"value":"(\"cfbe6501-9add-496a-b88d-3fa052a88a41\")"}
