;; **
;;; # 7. Invariants
;;; 
;;; Above we have seen how constraints can be checked and enforced manually. Constraints can also be defined as _invariants_ over graph processes.
;;; 
;;; The definition of invariants can have one of two modes:
;;; 
;;; 1. **enforced** invariants are guaranteed by disallowing any graph in the graph process that does not satisfy the invariant
;;; 
;;; 1. **asserted** invariants are checked upon each occurrence in the graph process and violations are reported through exceptions
;;; 
;;; ## 7.1 Enforced invariants
;;; 
;;; As an example, let's assume we want to allow only one single `to` edge from a `Hello` node. We can define the following constraint (and then use its negation as an enforced invariant on a graph).
;; **

;; @@
(constraint 'multiple-to! 
            (pattern (node 'h :label "Hello")
                     (node 'n1)
                     (node 'n2)
                     (edge 'e :label "to" :src 'h :tar 'n1)
                     (edge 'e2 :label "to" :src 'h :tar 'n2)
                     ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"227\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x42958bcf \"BufferedImage@42958bcf: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7035e53f transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 227 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; We can now create a graph where the negation of this constraint is an enforced invariant.
;; **

;; @@
(def g (-> (newgrape) (enforce-invariant multiple-to!-)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheet1/g</span>","value":"#'worksheet1/g"}
;; <=

;; **
;;; Let's try to apply two times the `world` rule: 
;; **

;; @@
(-> g hello world world)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As we can see above, there is no result (i.e., the enforced invariant has prevented the second application of `world`).
;;; 
;;; In comparison, let's do the same on a graph that does not have the enforced invariant. The example below shows that without the enforced invariant, the operation succeeds.
;;; 
;; **

;; @@
(-> (newgrape) hello world world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"417\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5ca0a26b \"BufferedImage@5ca0a26b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7035e53f transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 417 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x5ca0a26b \"BufferedImage@5ca0a26b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7035e53f transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 417 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 417, :height 251})"}
