;; **
;;; ## 7.2 Asserted invariants
;;; In contrast the _enforced_ invariants, _asserted_ invariants are monitored but not enforced. Occurrences that violated asserted invariants are reported as exceptions. Lets consider the same example, but this time wiht an asserted invariant:
;; **

;; @@
(def g (-> (newgrape) (assert-invariant multiple-to!-)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheet1/g</span>","value":"#'worksheet1/g"}
;; <=

;; **
;;; Let's cause a violation of the assertion:
;; **

;; @@
(-> g hello world world)
;; @@

;; **
;;; ## 7. Graph Queries
;;; 
;;; Graph queries are used to extract data from a graph and to visualize parts of interest.
;;; 
;;; By convention and to distinguish queries from rules and constraints, names of queries should be appended with a question mark (**?**).
;;; 
;;; Like rules and constraints, queries can be applied to Grapes, but they return a relation for each graph in the Grape.
;;; 
;;; Consider the following query as an example:
;; **

;; @@
(query 'hello-to? []
       (pattern 
         (node 'h :label "Hello")
         (node 'x)
         (edge 'e :label "to" :src 'h :tar 'x)))
