;; **
;;; Note that using the alternative looping macro (without confluence check) would indeed result in an infinite process when used in the modified program (which only allows ferry crosses with cargo.)
;;; 
;;; ## 8.1. Solving the Ferryman Problem with Invariants
;;; 
;;; Alternatively, we can solve the Ferryman Problem using invariants. We define avoidance of the two dangerous moves as enforced (negative) invariants, and we assert the invariant that a solution cannot be found. We can then use the unconditional looping macro __->**__ since we no longer need the test (it's convered with our assertion.)
